'use strict'

import PropTypes from 'prop-types';
import React, {Component} from 'react'
import {
  requireNativeComponent,
  UIManager,
} from 'react-native'

import { FocusableRef } from "./private/FocusableRef.js"
import { TimelineHolder } from "./private/TimelineHolder.js"

let _ViewRef = requireNativeComponent('ViewRef')

class ViewRef extends React.Component {

  constructor(props) {
    super(props);
  }

  render() {
    return (
      <_ViewRef
        {...this.props}
      />
    );
  }
}

export default TimelineHolder(FocusableRef(ViewRef));
